import React from 'react';
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';
import './Carousel.css';

const Slider = () => {

    const languageData = [
        {
            id: 1,
            title:'HTML',
            image:'',
            info:'HTML'
        },
        {
            id: 2,
            title:'CSS',
            image:'',
            info:'CSS'   
        }
    ]

    return (
        <Carousel>
            <div>Slider 1</div>
            <div>Slider 2</div>
            <div>Slider 3</div>
        </Carousel>
    );
};

export default Slider;
